import React from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
} from '@mui/material';

import FormText2Image from './FormText2Image.js';

const Text2Image = () => {
    return (
        <Container maxWidth='xxl'>
            <Grid2 container spacing={2}>
                <Grid2 size={{ xs: 12, md: 6 }}>
                    <FormText2Image />
                </Grid2>
                <Grid2 size={{ xs: 12, md: 6 }}>
                    Hello
                </Grid2>
            </Grid2>
        </Container>
    )
}

export default Text2Image
